%% === 第二部分：动力学可视化 (质量与惯量) ===
% 注意：这里的G矩阵是对角阵，意味着提供的惯量是基于Principal Axes的，且假设CoM在坐标系原点。
% 如果CoM不在原点，G矩阵通常不是对角阵。为了可视化，我们假设 Frame Origin = CoM。

figure('Name', 'UR5 Dynamics Parameters', 'Color', [1 1 1]); %[output:623a6da5]
hold on; grid on; axis equal; %[output:623a6da5]
xlabel('X (m)'); ylabel('Y (m)'); zlabel('Z (m)'); %[output:623a6da5]
view(135, 30); %[output:623a6da5]
title('UR5 Mass Distribution & Inertia Ellipsoids'); %[output:623a6da5]

% 重新绘制骨架作为参考
plot3(origins(1,:), origins(2,:), origins(3,:), 'k-', 'LineWidth', 0.5, 'Color', [0.8 0.8 0.8]); %[output:623a6da5]

num_links = size(Glist, 3); % 只有6个连杆有动力学参数

for i = 1:num_links
    % 获取当前连杆的变换 T0i
    T_curr = T_global_list(:,:,i);
    R_curr = T_curr(1:3, 1:3);
    p_curr = T_curr(1:3, 4);
    
    % 获取动力学参数
    Gi = Glist(:,:,i);
    % Modern Robotics G = [Inertia, 0; 0, mI]
    % 提取质量 m
    m = Gi(4,4);
    % 提取转动惯量矩阵 I (3x3)
    I_tensor = Gi(1:3, 1:3);
    
    %% A. 可视化质量 (Mass) -> 用球体大小表示
    % 质量越大，球越大。比例系数需根据实际观感调整
    radius_mass = 0.04 * (m^(1/3)); 
    [Xs, Ys, Zs] = sphere(20);
    
    % 变换球体到当前坐标系位置
    Xs_m = Xs * radius_mass + p_curr(1);
    Ys_m = Ys * radius_mass + p_curr(2);
    Zs_m = Zs * radius_mass + p_curr(3);
    
    % 绘制质量球 (半透明青色)
    surf(Xs_m, Ys_m, Zs_m, 'FaceColor', 'c', 'EdgeColor', 'none', 'FaceAlpha', 0.3); %[output:623a6da5]
    
    %% B. 可视化惯量 (Inertia) -> 用等效椭球表示
    % 物理意义：惯量越大，物体在该轴向上分布越广。
    % 对于均匀密度的椭球体: Ixx = m/5 * (b^2 + c^2), etc.
    % 我们可以反解出椭球的半轴长 a, b, c 来直观展示形状。
    
    % 由于G是对角的，Ixx, Iyy, Izz 是主惯量
    Ixx = I_tensor(1,1);
    Iyy = I_tensor(2,2);
    Izz = I_tensor(3,3);
    
    % 解方程组求解等效几何尺寸 (a,b,c):
    % Ixx + Iyy - Izz = 2/5 * m * c^2  => c = sqrt(2.5/m * (Ixx+Iyy-Izz))
    % 注意：有时候如果数据不物理，根号内可能为负，取绝对值防止报错
    sq_factor = 2.5 / m;
    a_ellip = sqrt(abs(sq_factor * (Iyy + Izz - Ixx)));
    b_ellip = sqrt(abs(sq_factor * (Ixx + Izz - Iyy)));
    c_ellip = sqrt(abs(sq_factor * (Ixx + Iyy - Izz)));
    
    % 生成单位球点
    [Xe, Ye, Ze] = sphere(30);
    
    % 1. 缩放 (Scale)
    Xe = Xe * a_ellip;
    Ye = Ye * b_ellip;
    Ze = Ze * c_ellip;
    
    % 2. 旋转 (Rotate) - 将椭球主轴对齐到坐标系方向
    % 构造点集矩阵 3xN
    pts = [Xe(:)'; Ye(:)'; Ze(:)'];
    pts_rot = R_curr * pts; % 应用旋转矩阵
    
    % 3. 平移 (Translate)
    Xe_final = reshape(pts_rot(1,:), size(Xe)) + p_curr(1);
    Ye_final = reshape(pts_rot(2,:), size(Ye)) + p_curr(2);
    Ze_final = reshape(pts_rot(3,:), size(Ze)) + p_curr(3);
    
    % 绘制惯量椭球 (线框模式，橙色)
    mesh(Xe_final, Ye_final, Ze_final, 'EdgeColor', [0.8500 0.3250 0.0980], 'FaceAlpha', 0);
    
    % 标注
    text(p_curr(1), p_curr(2), p_curr(3), sprintf('  m=%.1fkg', m), 'FontSize', 8, 'Color', 'k');
end

